import CartItem from "./CartItem";

export default function CartItemList({items}) {

    let list = [{amount: 0, ...items}];
    let filteredList = list.filter((el, index) => {
        let itemRepeat = list.indexOf(el);
        if (itemRepeat !== index) {
            list.splice(itemRepeat, 1);
            list[list.indexOf(el)].amount += 1;
        }
    })

    return (
        <div className="CartList">

        </div>
    )
}
